import { GET_PROFILE, PROFILE_ERROR } from './types';



const initialState = {
    profile: null,
    profiles: [],
    repos: [],
    loading: true,
    error: {}
}


export default function(state = initialState, action) {

    const { type, payload} = action;

    let nextState ;

    switch(type){

        case GET_PROFILE: 
            return nextState= {
                ...state,
                profile: payload,
                loading: fals
            };

        case PROFILE_ERROR:
            return nextState = {
                ...state,

            }    

         default:
                return nextState || state;   
    }

}
